import './Styles/Styles.scss';
import './App.css';
import { Navbar } from './Sections/Navbar/Navbar';
import { Background } from './Components/Background/Background';
import { Loading } from './Components/Loading/Loading';

function App() {
  return loading ? (
		<Loading/>
	) : (
    <div className="App">
      <Navbar/>
      <Background/>

    </div>
  );
}

export default App;
